import React from "react";
import logo from "./images/logo.png";
import angleDown from "./images/angledown.png";

const Navbar = () => {
    return (
        <nav className="flex flex-col md:flex-row md:justify-between md:items-center px-5 py-auto">
            <div className="flex items-center">
                <img src={logo} alt="Logo" className="w-12 h-12" />
                <div className="ml-2 md:ml-0 md:text-3xl font-semibold text-white">FOSSCU</div>
            </div>
            <div className="mt-4 md:mt-0">
                <ul className="flex flex-col md:flex-row md:justify-between md:items-center space-y-2 md:space-y-0 md:space-x-4">
                    <li className="text-green-500 font-semibold text-lg cursor-pointer hover:text-green-300 transition duration-200">Home</li>
                    <li className="text-white font-semibold text-lg cursor-pointer hover:text-gray-300 transition duration-200">About</li>
                    <li className="text-white font-semibold text-lg cursor-pointer hover:text-gray-300 transition duration-200">Team</li>
                    <li className="text-white font-semibold text-lg cursor-pointer hover:text-gray-300 transition duration-200">Contact</li>
                    <li className="text-white font-semibold text-lg cursor-pointer hover:text-gray-300 transition duration-200">Shipyard</li>
                    <li className="text-white font-semibold text-lg cursor-pointer flex items-center hover:text-gray-300 transition duration-200">More<img src={angleDown} alt="More" className="w-6 h-6 ml-1" /></li>
                </ul>
            </div>
        </nav>
    );
};

export default Navbar;
